    <style>
      html {
        font-size: 62.5%;
      }
      /* #_total_div_parent{

      .Combating_covid {
        width: 100%;
        /* border: 0.1rem solid; */
      }
      .Combating_covid > img {
        width: 100%;
      }
      #Essential_things {
        width: 90%;
        /* border: 0.2rem solid black; */
        display: grid;
        grid-template-columns: repeat(3, 1fr);
        grid-template-rows: repeat(2, 1fr);
        gap: 3%;
        margin: auto;
        height: auto;
      }
      #Essential_things > div {
        /* border: 0.2rem solid red; */
        border-radius: 2%;
      }
      #Essential_things > div img {
        width: 100%;
      }
      #Essential_things > div:hover {
        box-shadow: rgba(0, 0, 0, 0.35) 0px 5px 15px;
        cursor: pointer;
      }
      #Download_Ebook{
        /* border: 0.2rem solid black; */
        width: 80%;
        margin: auto;
        display: grid;
        grid-template-columns: repeat(3,1fr);
        gap: 3rem;
        
      }
      #Download_Ebook>div:hover{
        /* border: 0.1rem solid red; */
        box-shadow: rgba(0, 0, 0, 0.35) 0px 5px 15px;
        cursor: pointer;
      }
      #Download_Ebook>div>img{
        width: 100%;
      }
      .Download_Ebook_div{
        background-color: rgb(255,105,79);
        width: 100%;
        text-align: center;    
        padding:4.5% 0% 4% 0%;
        border-radius: .5rem;
        font-family: Arial, Helvetica, sans-serif;
        font-weight: bold;
        font-size: 1.5rem;
        margin-top: 2.3rem;
        cursor: pointer;
        color: white;
      }
      .Download_Ebook_div>a{
        text-decoration: none;
        color: white;
      }
      .Download_Ebook_div>a:hover{
        box-shadow: rgba(0, 0, 0, 0.35) 0px 5px 15px;
        color: black;
      }
      #detaileed_video_about_covid{
        border: 0.1rem solid transparent;
        width: 80%;
        padding: 3%;
        margin: auto;
        display: grid;
        grid-template-columns: repeat(2,1fr);
        grid-template-rows: repeat(2,1fr);
        gap: 2%;
        background-color: rgb(255,240,227);
        border-radius: 1%;
      }
      #detaileed_video_about_covid>div{
        /* border: 0.1rem solid red; */
        background-color: rgb(255,240,227);
      }
      #detaileed_video_about_covid>div>iframe{
        width: 100%;
      }
    
      @media all and (min-width: 597px) and (max-width: 900px) {
        html {
          font-size: 40%;
        }
       
      }
      @media all and (min-width: 351px) and (max-width: 596px) {
        html {
          font-size: 27%;
        }
     
      }
      @media all and (min-width: 200px) and (max-width: 350px) {
        html {
          font-size: 19%;
        }
      
      }
      @media all and (min-width: 100px) and (max-width: 201px) {
        html {
          font-size: 13%;
        }
       
      }
      @media all and (min-width: 1px) and (max-width: 1500px) {
        #_total_div_parent{
        width: 100%;
        /* display: flex; */
        /* align-items: center;
        justify-content: center; */
      }
      #total_DIV{
        /* border: 0.3rem solid red; */
        width: 100%;
        margin: auto;
       
      }
      #div_for_navbar{
        /* border: 0.3rem solid red; */
        width: 100%;
        margin: auto;
      }
      }
